<script setup>
import { onMounted, onUnmounted, ref } from 'vue';
import { useMessage } from 'naive-ui';
import { ArchiveOutline as ArchiveIcon } from '@vicons/ionicons5';
import { lyla, SOCKET_URL } from '@/request';
import VuePictureCropper, { cropper } from 'vue-picture-cropper';
import {
  SHARD_SIZE,
  INFO_NO_FILE,
  PDF2IMG_MODE,
  WEBSOCKET_TYPE,
} from '@/config/const.config';
import { onlyAllowNumber } from '@/utils';

const message = useMessage();
const upload = ref(null);
const ws = ref(null);

const fileList = ref([]);
const images = ref([]);
const current = ref(0);
const pageNumberTable = ref('');
const cropend = ref('');
const rect = ref([]);
const response = ref({
  code: 0,
  data: {
    mapping_results: [
      ['1', true, 1, 1],
      ['2', true, 1, 1],
      ['8', true, 1, 1],
      ['3', true, 1, 1],
      ['4', true, 1, 1],
      ['5', true, 1, 1],
      ['6', true, 1, 1],
      ['7', true, 1, 1],
      ['9', true, 1, 1],
      ['11', true, 1, 1],
      ['10', true, 1, 1],
      ['12', true, 4, 4],
      ['13', false, 1, 2],
      ['14', true, 1, 1],
      ['15', true, 2, 2],
      ['16', true, 1, 1],
      ['17', true, 1, 1],
      ['18', true, 1, 1],
      ['19', true, 1, 1],
      ['20', true, 2, 2],
      ['21', true, 4, 4],
      ['22', true, 1, 1],
      ['23', true, 1, 1],
      ['24', true, 1, 1],
    ],
    error_pages: [
      [
        'data:image/png;base64,',
      ],
      [34],
    ],
    note: '\n, 7,18 ',
  },
  msg: '',
});
// const response = ref({
//   code: null,
//   data: {
//     error_pages: [[], []],
//     mapping_results: [],
//     note: '',
//   },
//   msg: '',
// });

const loadingUpload = ref(false);
const loadingPartCount = ref(false);

const openWebsocket = () => {
  loadingUpload.value = true;
  const websocket = new WebSocket(SOCKET_URL);

  websocket.onopen = (e) => {
    console.log('connected: ', e);
    sendMessage();
  };
  websocket.onclose = (e) => {
    console.log('disconnected: ', e);
    loadingUpload.value = false;
  };
  websocket.onmessage = (e) => {
    const data = JSON.parse(e.data);
    const { img_base64, total, current } = data;
    if (img_base64) {
      images.value.push({ src: img_base64, page: current });
      current == total && ws.value.close();
    }
  };
  websocket.onerror = (e) => {
    console.log('error: ', e);
  };

  ws.value = websocket;
};

const sendMessage = () => {
  const file = fileList.value[0].file;
  const size = file.size;
  const total = Math.ceil(size / SHARD_SIZE);
  const params = {
    type: WEBSOCKET_TYPE.PDF2IMG,
    fileName: file.name,
    total,
    options: {
      mode: PDF2IMG_MODE.NORMAL,
      end: 10,
    },
  };
  for (let i = 0; i < total; i++) {
    const start = i * SHARD_SIZE;
    const end = Math.min(size, start + SHARD_SIZE);
    const fileClip = file.slice(start, end);
    const reader = new FileReader();
    reader.onload = (e) => {
      Object.assign(params, {
        file: reader.result,
        current: i + 1,
      });
      ws.value.send(JSON.stringify(params));
    };
    reader.readAsDataURL(fileClip);
  }
};

const handleGetCrop = () => {
  const base64 = cropper.getDataURL();
  const data = cropper.getData(true);
  rect.value = [data.x, data.y, data.width, data.height];
  cropend.value = base64;
};

const handleUpload = () => {
  if (!fileList.value.length) {
    message.info(INFO_NO_FILE);
    return;
  }
  openWebsocket();
};

const handlePartCount = () => {
  let pageNumber = parseInt(pageNumberTable.value);
  if (Number.isNaN(pageNumber)) {
    message.error('');
    return;
  }
  loadingPartCount.value = true;
  const file = fileList.value[0].file;
  const formData = new FormData();
  formData.append('filename', file.name);
  for (let i = 0; i < 4; i++) {
    formData.append('rect', rect.value[i]);
  }
  formData.append('pageNumberExplore', images.value[current.value]?.page);
  formData.append('pageNumberTable', pageNumberTable.value);
  lyla
    .post('/partCount', { body: formData })
    .then((res) => {
      console.log(res);
      response.value = res.json;
    })
    .catch((err) => {})
    .finally(() => {
      loadingPartCount.value = false;
    });
};

const handleKeyDownEsc = (e) => {
  if (e.keyCode == 27) {
    cropper.clear();
  }
};

const boxStyle = {
  height: '400px',
  width: '100%',
  border: '1px dashed rgb(224, 224, 230)',
  borderRadius: '3px',
  marginTop: '8px',
};

const options = {
  viewMode: 1,
  dragMode: 'move',
  autoCrop: true,
  cropend: handleGetCrop,
};

const columns = [
  {
    title: '',
    key: 'no',
    sorter: (a, b) => parseInt(a[0]) - parseInt(b[0]),
    render: (_) => parseInt(_[0]),
  },
  {
    title: '',
    key: 'state',
    render: (_) => (_[1] ? '' : ''),
  },
  {
    title: '',
    key: 'found',
    render: (_) => (_[2] == null ? '-' : _[2]),
  },
  {
    title: '',
    key: 'expected',
    render: (_) => (_[3] == null ? '-' : _[3]),
  },
];

const renderRowClass = (rowData) => (rowData[1] ? '' : 'row-error');

onMounted(() => {
  document.addEventListener('keydown', handleKeyDownEsc);
});

onUnmounted(() => {
  document.removeEventListener('keydown', handleKeyDownEsc);
});
</script>

<template>
  <n-space vertical>
    <!-- upload -->
    <div>
      <n-h3 prefix="bar">1. PDF</n-h3>
      <n-spin :show="loadingUpload">
        <n-upload
          ref="upload"
          accept=".pdf"
          :max="1"
          :default-upload="false"
          v-model:file-list="fileList"
          @change="(data) => (fileList = data.fileList)"
        >
          <n-upload-dragger>
            <div style="margin-bottom: 12px">
              <n-icon size="48" :depth="3">
                <archive-icon />
              </n-icon>
            </div>
            <n-text style="font-size: 16px">
              
            </n-text>
            <n-p depth="3" style="margin: 8px 0 0 0">
              pdf
            </n-p>
          </n-upload-dragger>
        </n-upload>
        <n-button type="primary" ghost @click="handleUpload">
          
        </n-button>
      </n-spin>
    </div>
    <!-- preview -->
    <n-spin :show="loadingPartCount">
      <n-h3 prefix="bar">2. </n-h3>
      <n-space>
        <n-input
          v-model:value="pageNumberTable"
          :allow-input="onlyAllowNumber"
          type="text"
          placeholder=""
        />
        <n-button type="primary" ghost @click="handlePartCount">
          
        </n-button>
      </n-space>
      <div class="scroll-box">
        <n-scrollbar class="n-scrollbar" x-scrollable>
          <div class="preview-box">
            <div class="preview-item" v-for="(img, i) in images" :key="i">
              <n-badge
                :value="i + 1"
                :color="current == i ? '#18a058' : 'gray'"
                :offset="[-10, 10]"
              >
                <n-image
                  :src="img.src"
                  alt="image"
                  height="200px"
                  preview-disabled
                  @click="() => (current = i)"
                />
              </n-badge>
            </div>
          </div>
        </n-scrollbar>
        <div class="preview-crop">
          <n-image
            v-show="cropend"
            :src="cropend"
            height="120px"
            width="100%"
            alt="image"
          />
        </div>
      </div>
      <vue-picture-cropper
        :boxStyle="boxStyle"
        :img="images[current]?.src"
        :options="options"
      />
    </n-spin>
    <!-- result -->
    <div>
      <n-h3 prefix="bar">3. </n-h3>
      <n-p>{{ response.data?.note }}</n-p>
      <n-image-group>
        <n-space>
          <div
            class="preview-item"
            v-for="(img, i) in response.data.error_pages?.[0]"
            :key="i"
          >
            <n-badge :value="response.data.error_pages?.[1][i]">
              <n-image :src="img" alt="image" height="200px" />
            </n-badge>
          </div>
        </n-space>
      </n-image-group>
      <n-data-table
        size="small"
        :bordered="false"
        :columns="columns"
        :data="response.data?.mapping_results"
        :row-class-name="renderRowClass"
      />
    </div>
  </n-space>
</template>

